Desi Italian Golgappas
----------------------------

Preparation time: 20 mins 
Cooking time: 10 mins

Ingredients:

Potatoes- 4-5 medium sized
Onions- 2 medium sized (diced)
Coriander leaves
Green chillies
Olive oil/Mustard oil
Turmeric powder
Chilli powder
Coriander powder
Kitchen king masala
Garam masala
Chaat masala
Oregano
Chilli flakes
Parsley
Salt
Pepper
Ready made golgappa balls
Coriander chutney
Tamarind chutney
Pudina chutney
Mayonnaise
Cheese, lots of cheese !!

Recipe:

1. Boil potatoes in a cooker/deep dish with 1 tbsp of salt, until soft. Unpeel the potatoes and mash them to form a smooth dough. 

2. Heat a saucepan and 2 tbsp of olive oil/mustard oil. Add diced onions and a pinch of salt. Saute until golden brown. Add the mashed potatoes. Add 1/2 tbsp turmeric, 1 tbsp chilli powder, 2 tbsp coriander powder, 1 tbsp kitchen king masala, 1 tbsp garam masala. Saute until spices are properly cooked. Add 1/2 tbsp of oregano, chilli flakes, parsley each and saute for 30 seconds. Add salt and pepper as per taste. 

3. Take a microwaveable plate and keep hole poked golgappa balls into it. Put the above mixture into these balls. Add coriander chutney, tamarind chutney, pudina chutney,  mayonnaise mixed with 1 tbsp of oregano and @everestspices pani puri masala each. 

4. Shred 3 cheese cubes or simply keep keep 3-4 cheese slices on these Golgappas and microwave for 30 seconds until the cheese melts and drips into the Golgappas. 

5. Sprinkle some chopped onions, coriander, green chillies and Chaat masala. 

It's ready to be served!!

